import requests
import xlrd
import openpyxl
import global_vars

def attachSemantics():
    sensor = 'true'
    key = "&key=AIzaSyCbb0jbXn2QIE3kXzrNxORoqkLji5CkxzI"
    base = "https://maps.googleapis.com/maps/api/geocode/json?"
    all_lat_longs = []
    wb = xlrd.open_workbook('locations.xlsx')
    sheet = wb.sheet_by_index(0)
    row_count = sheet.nrows
    for row_num in range(1, row_count):
        lat = float(sheet.cell_value(row_num, 1))
        long = float(sheet.cell_value(row_num, 2))
        lat_long = (lat,long)
        all_lat_longs.append(lat_long)
    print(all_lat_longs)

    wb = openpyxl.load_workbook(filename='locations.xlsx')
    type_wb = openpyxl.Workbook()  # for creating types file
    type_sheet = type_wb.active
    type_sheet.title = 'Semantics'
    type_sheet.cell(row=1,column=1).value = 'TypeID'
    type_sheet.cell(row=1,column=2).value = 'Type'
    type_row = 2
    type_id = 1
    TYPE_DICT = {} #dictionary to map type name with count of type ,
                    # will be useful to check if a type is already present in the sheet
                   #and is not needed to insert again

    ws = wb.worksheets[0]
    ws.cell(row=1,column=5).value = "Type"
    for index in range(1,row_count):
        params = "latlng={lat},{lon}&sensor={sen}".format(
                lat=str(all_lat_longs[index-1][0]),
                lon=str(all_lat_longs[index-1][1]),
                sen=sensor
            )
        url = "{base}{params}{key}".format(base=base, params=params, key=key)
        response = requests.get(url)
        print(f'{response.json()["results"]}\n')
        type = response.json()["results"][0]["types"]
        ws.cell(row=1+index,column=5).value= ",".join(type)
        for current_type in type:
            if not current_type in TYPE_DICT: #check if this type is not already present in file and gets more than one id
                type_sheet.cell(row=type_row,column=1).value = type_id
                type_sheet.cell(row=type_row,column=2).value = current_type
                global_vars.TYPES_DICT[current_type] = type_id
                type_row+=1
                type_id+=1
                TYPE_DICT[current_type] = 1
            else:
                TYPE_DICT[current_type]+=1
    wb.save('locations.xlsx')
    type_wb.save('types.xlsx')
    findTypeCorrelation()


