def createTypeCorrelationFile(type_correlation):

    reverse_map = {}
    for key in global_vars.TYPES_DICT:
        reverse_map[global_vars.TYPES_DICT[key]] = key

    wb = openpyxl.Workbook()
    correlationSheet = wb.active
    correlationSheet.title = 'Type_Correlation'
    for i in range(2,len(type_correlation)+1):
        correlationSheet.cell(row=i,column=1).value = reverse_map[i-1]
        correlationSheet.cell(row=1,column=i).value = reverse_map[i-1]
    for index1 in range(1,len(type_correlation)):
        for index2 in range(1,len(type_correlation)):
            correlationSheet.cell(row=1+index1,column=1+index2).value = type_correlation[index1][index2]
    wb.save('Type_Correlation.xlsx')



def createClusterToType():
    clusterIDtoType = {}
    wb = xlrd.open_workbook('locations.xlsx')
    sheet = wb.sheet_by_index(0)
    row_count = sheet.nrows
    for row_num in range(1,row_count):
        clusterID = int(sheet.cell_value(row_num,0))  #to get the key as the clusterID
        clusterIDtoType[clusterID] = str(sheet.cell_value(row_num,4)).split(',') # value will be the list of semantics attached to that location
    print(clusterIDtoType)
    return clusterIDtoType

